import './App.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faEnvelope } from '@fortawesome/free-solid-svg-icons'

function App() {
  return (
    <div className="App">
      <p>Hello World</p>
      <button class="button">Click Me</button>
      <FontAwesomeIcon icon={"fa-regular fa-hand-peace"} />
    </div>
  );
}

export default App;
